import React from 'react';
import { BrowserRouter as Router, Route, Link, Switch} from "react-router-dom";
import CurrencyConverter from './CurrencyConverter';
import ExchangeRates from './ExchangeRates';
import { FaTwitter, FaLinkedin, FaGithub, FaGlobe } from 'react-icons/fa';

const NotFound = () => {
  return <h2>404 Not Found</h2>;
}

const App = () => {
  return (
    <React.Fragment>
      <Router>
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
          <Link className="navbar-brand" to="/">Currency Converter</Link>
        </nav>

        <Route path="/" exact component={ CurrencyConverter } />
        <Route path="/" component={ ExchangeRates } />
        <Route component={NotFound} />
      </Router>
      <footer className="text-center text-lg-start bg-light">
      <h4><FaTwitter /> <a target="_blank" href="twitter.com">www.twitter.com</a></h4>
      <h4><FaLinkedin /> <a target="_blank" href="linkedin.com">www.linkedin.com</a></h4>
      <h4><FaGithub /> <a target="_blank" href="www.github.com/henry-hein">www.github.com/henry-hein</a></h4>
      <h4><FaGlobe /> <a target="_blank" href="www.google.com">www.currencyconverter.com</a></h4>
    </footer>
   </React.Fragment>
  );
}



export default App;
